var app = angular.module('matmat', ["ngCookies", "ngAnimate", "mm.foundation"]);

app.factory("SimulatorGlobal", function(){
        return {
            test: "hello world",
//            for simulators
            submit: null,                   // function which ends question in simulator
            skip: null,                     // function which skip question in simulator
            simulator_active: false,        // indicate if simulator is active - the question is not answered
            input: {"value": ""},           // current input
            keyboard: 'gone',               // keyboard mode
            log_something: null,            // simulator logger function
            get_simulator_list: null,       // list of selected simulator pk
            clear_queue: null,              // function which clear questions from queue
            description: {top: ""}          // description
        }
    }
);

app.config(["$httpProvider", function($httpProvider){
    $httpProvider.defaults.xsrfCookieName = 'csrftoken';
    $httpProvider.defaults.xsrfHeaderName = 'X-CSRFToken';
}]);

app.controller("singin", ["$scope", "$http", function($scope, $http){
    $scope.submit = function(){
        $http.post("/ajaxlogin/",
            {
                password: $scope.password,
                username: $scope.username
            })
            .success(function (data) {
                if (data.success){
                    window.location.replace("/");
                    $scope.msg =  "Pihleno";
                    $scope.msg_color =  "green";
                }else{
                    $scope.msg =  data.error_msg;
                    $scope.msg_color =  "red";
                }
            }).error(function (){
                $scope.msg =  "Chyba pi komunikaci se serverem.";
                $scope.msg_color =  "red";
        });
    }
}]);


app.controller("send_child", ["$scope", function($scope){
    $scope.neco = function(){
        console.log($scope.name);
    }
}]);

app.directive('keypressEvents', ["$document", "$rootScope", function ($document, $rootScope) {
    return {
        restrict: 'A',
        link: function () {
            $document.bind('keypress', function (e) {
                $rootScope.$broadcast('keypress', e, String.fromCharCode(e.which));
            });
        }
    };
}]);

app.directive('nextAction', [function() {
    return {
        scope: {
            condition: '=nextAction'
        },
        link: function ($scope, element) {
            $scope.$on('keypress', function (e, a, key) {
                if (a.keyCode === 13 && $scope.condition) {
                    angular.element(element).triggerHandler('click');
                }
            });
        }
    };
}]);
app.controller("Feedback", ["$scope", "$http", "$location", function($scope, $http, $location){
    $scope.feedback = {};

    $scope.submit = function(){
        $scope.feedback.url = $location.absUrl();
        $http.post('/feedback', $scope.feedback)
            .success(function(data){
                $scope.msg_tag = "success";
                $scope.msg = data.msg;
                $scope.sending = false;
                $scope.feedback.text = ""
            }).error(function(){
                $scope.msg = "V aplikaci bohuel nastala chyba.";
                $scope.msg_tag = "alert";
                $scope.sending = false;
            });
        $scope.sending = true;
    };

    $(document).on('closed.fndtn.reveal', '[data-reveal]', function () {
        var modal = $(this);
        $scope.msg = "";
    });
}]);
app.controller("mySkills", ["$scope", function($scope){
    $scope.$watch("skills", function(skills){
        process_skills(skills, $scope.userSkills, $scope.userDiffs, $scope.active);
    });
}]);


app.controller("childrenComparison", ["$scope", "$http", function($scope, $http){

    var get_data = function(){
        $http.get("/m/children_comparison")
            .success(function(data){
                $scope.skills = data.skills;
                $scope.base_skills = data.base_skills;
                $scope.sub_skills = data.sub_skills;
                $scope.userSkills = data.user_skills;
                $scope.userDiffs = data.user_diffs;
                $scope.children = data.children;
                $scope.answer_counts = data.answer_counts;
                $scope.answer_correct_counts = data.answer_correct_counts;
                $scope.children_ids = data.children_ids;

                angular.forEach($scope.children_ids, function(user) {
                    if (!$scope.pure_skills){
                        $scope.pure_skills = $scope.skills[user];
                    }
                    process_skills($scope.skills[user], $scope.userSkills[user], $scope.userDiffs[user], null, $scope.children[user].user_pk);
                });
            })
    };

    get_data()
}]);


process_skills = function(skills, userSkills, userDiffs, active, user){
    for (var key in skills) {
        if (skills.hasOwnProperty(key)) {
            skill = skills[key];
            if(user){
                skill.user = user;
            }
            skill.value = userSkills[skill.name];
            skill.diff = userDiffs[skill.name];
            skill.color = get_color(skill.value, skill.diff);
            skill.style = {
                'background-color': 'rgba({0}, {1}, {2}, {3})'.format(skill.color.r, skill.color.g, skill.color.b, skill.color.alpha)
            };
            if (skill.image !== null) {
                skill.style['background-image'] = 'url(' + skill.image + ')';
            }
            skill.style2 = {
                'background': 'linear-gradient(to left, white, rgba({0}, {1}, {2}, {3}))'.format(skill.color.r, skill.color.g, skill.color.b, skill.color.alpha)
            };
            if (active) {
                skill.active = active.indexOf(skill.name) !== -1;
            }
            skill.diamonds = [false, false, false, false, false];
            skill.fromFive = Math.round(1 / (1 + Math.exp(-skill.value)) * 5);
            for (var i = 0; i < skill.fromFive; i++){
                skill.diamonds[skill.diamonds.length - 1 - i] = true;
            }
        }
    }
};
